                            {/* visit start*/}
                            <div className="patient_order_detail">
                                <div className="patient_order_content">
                                    <div className="patient_order_d sr">
                                        <span>02</span>
                                    </div>
                                    <div className="patient_order_d ph">
                                        <span>Dr. Ardiles, Osvaldo</span>
                                    </div>

                                    <div className="patient_order_d pr">
                                        <span>
